import { FormControl, FormControlLabel, FormControlLabelText, Input, InputField } from '@gluestack-ui/themed';
import { Box, VStack } from '@gluestack-ui/themed';


const RegisterView = () => {
    return <Box justifyContent="center" alignItems="center">
        <VStack>
            <FormControl size={"md"} isDisabled={false} isRequired={false}>
                <FormControlLabel>
                <FormControlLabelText color="black" ml="$9" fontSize={"$sm"} fontWeight='$bold'>Username</FormControlLabelText>
                </FormControlLabel>
                <Input>
                    <InputField type="password" defaultValue="" placeholder="Name" mt={"$5"} w={"$3/4"} borderRadius={"$sm"} />
                </Input>
            </FormControl>
        </VStack>
    </Box>;
};
export default RegisterView;
